import "./App.css";
import { Routers, Route } from "react-router-dom";
import Shelf from "./Shelf"
import SearchBooks from "./SearchBooks"

function App() {

    return (
        <Routers>
            <Route exact path="/" element={
                <Shelf/>
            }/>
            <Route path="/search" element={
                <SearchBooks />
            }/>
        </Routers>
    );
}


export default App;
